declare const SQL_QUERY = "\nCREATE TABLE IF NOT EXISTS Election (\n  \"id\" TEXT NOT NULL,\n  \"electionDate\" INTEGER,\n  \"name\" TEXT,\n  \"type\" TEXT CHECK(`type` in ('PRIMARY', 'GENERAL', 'SPECIAL', 'LOCAL', NULL)),\n  \"turf\" TEXT,\n  CONSTRAINT ElectionPk PRIMARY KEY (\"id\")\n) WITHOUT ROWID;\n\n";
export default SQL_QUERY;
